


/*
This file creates a table called stops.
When loaded you must make a new table caled bus_stops in the Irish Nation Grid.
To load
psql -d postgis -U postgres  -f stops.sql


WGS84 (EPSG 4326)
We will  transform the geometry from  WGS84 (EPSG 4326) to ING (29900)
We make a table similar to stops but with no spatial column
CREATE TABLE bus_stops (
  srid integer,
   name character varying(30),
    stop_number integer
 );
 
Put the non spatial data into the new table

Add the geometry column for  ING 
SELECT AddGeometryColumn('','bus_stops','the_geom','29900','POINT',2);

Put the transformed data into the new bus_stops table
UPDATE  bus_stops  SET the_geom = ST_Transform(stops.the_geom,29900) FROM stops where  bus_stops.srid = stops.srid;



*/
CREATE TABLE stops (
    srid integer,
    name character varying(30),
    stop_number integer);
SELECT AddGeometryColumn('public','stops','the_geom','4326','POINT',2);
